Aw nuts, it means the game isn't recognizing the gameinit file. That's not good. The only choice we've got left at this point is to manually input the code. Open up the "main.cs" file in the game folder and copy-paste this code: 

"public class main {

  private void init {

  }

  public static void main (String[] arg) {

    init();" 


This should fix the problem. Save the file and try running the game again.

You know what, let's just try one more thing...

Open the "data" folder in the game files. Create a new text file called "init.cpp". Copy-paste this code into the document: 

"#include <stdio.h>

int main() {

printf ("Hello world!\n");

return 0;

}

"

Save the file and try running the game again.

